hypothesis:
Aceasta însemnă că trebuie să implementeze un sistem de gestionare a riscurilor cu trei componente:
:-informare: operatorul trebuie să aibă acces la informații privind lemnul și produsele din lemn, țara de recoltare (și, dacă este cazul, regiunea subnațională și concesiunea), speciile de lemn, cantitatea, detaliile furnizorului, precum și la informații privind conformitatea cu legislația națională;
:-evaluarea riscurilor: operatorul trebuie să evalueze riscul de a utiliza lemn exploatat ilegal în lanțul său de aprovizionare, pe baza informațiilor identificate mai sus și ținând seama de criteriile stabilite în eutr;
:-atenuarea riscurilor: dacă evaluarea arată că riscul de a utiliza lemn exploatat ilegal în lanțul de aprovizionare nu este neglijabil, acesta poate fi atenuat prin măsuri ulterioare, cum ar fi solicitarea de informații și verificări suplimentare din partea furnizorului.

În funcție de frecvența de participare la un anumit eveniment, se poate vorbi de:
* spectator accidental, care participă întâmplător la un eveniment;
* spectator ocazional, care participă din când în când la un eveniment, precum spectatorii care urmăresc proiecțiile de la un anumit cinematograf;
* spectator permanent, care participă la aproape toate evenimentele organizate într-un anumit loc, precum suporterii unui club sportiv.

premise:
În limbă coexistă cuvinte cu metateză în varietăți de limbă nestandard, de varietate regională sau de registru popular, cu variante fără metateză în varietatea standard, de exemplu, în română, ''protopop'' > ''potropop'';
: ''aks'' < ''ask'' (individuală) „a întreba”;
: ''ведмедь'' (vedmedĭ) (regională) < ''медведь'' (medvedĭ) „urs”, ''раболатория'' (rabolatoria) (individuală) < ''лаборатория'' (laboratoria) „laborator”.
